import Typography from '@mui/material/Typography';
import { SelectEl } from '../../..';
import { FormikValues } from 'formik';
import { Label } from '../../Label/Label';

type Cols = {
   color: string;
   id: number;
   tasks: {
      id: number;
      completedSubtasks: number;
      title: string;
      description: string;
      status: string;
      subtasks: {
         title: string;
         isCompleted: boolean;
      }[];
   }[];
   name: string;
}[];

interface Props extends FormikValues {
   cols: Cols;
}

export const EditorSelect: React.FC<Props> = ({
   values,
   handleChange,
   cols,
}) => {
   return (
      <>
         <Label >Status</Label>
         {/* <Typography
            style={{ margin: '24px 0 8px' }}
            className='subtasks-heading'
            variant='body2'
         >
            Status
         </Typography> */}

         <SelectEl value={values.status} onChange={handleChange} cols={cols} />
      </>
   );
};
